import { Component, OnInit } from '@angular/core';
import { StudentService } from 'src/app/shared/student.service';

@Component({
  selector: 'app-student',
  templateUrl: './student.component.html',
  styleUrls: []
})
export class StudentComponent implements OnInit{

  constructor(public studentSvc:StudentService){}

  ngOnInit(): void {

  }

}
<form #form="ngForm" autocomplete="off" *ngIf="studentSvc.studenytData">
    <div class="row">
        <div class="col-md-6">
            <div class="form-group">
                <label>First Name</label>
                <input name="FirstName" #FirstName="ngModel" [(ngModel)]="studentSvc.studenytData.FirstName" class="form-control">
            </div>
        </div>
    </div>
</form>
